import React from 'react'

const SchoolCard = (props) => {
    console.log("props>>>>",props.resData.attributes.PhotoUrl)
    return (
        <div className="w-[542px] h-[400px]">
        <img
            alt=""
            className="w-[542px] h-[300px]"
            src={props.resData.attributes.PhotoUrl}
        />
        <div className='bg-white w-[542px] h-[400px]'>{props.resData.attributes.Title}</div>

        </div>
    );
}

export default SchoolCard
